var __index = {"config":{"lang":["en"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"Home","text":""},{"location":"index.html#english","title":"English","text":"<p>This site contains all the documentation relating to projects of Loanbrwsk1</p>"},{"location":"index.html#francais","title":"Fran\u00e7ais","text":"<p>Ce site regroupe toutes les documentations relatives aux projets de Loanbrwsk1</p>"},{"location":"en/index.html","title":"Documentation en Fran\u00e7ais","text":""},{"location":"en/index.html#script-of-post-installation-for-fedora","title":"Script of post installation for Fedora","text":""},{"location":"en/index.html#script-of-post-installation-for-mint","title":"Script of post installation for Mint","text":""},{"location":"en/index.html#script-of-post-installation-for-ubuntu","title":"Script of post installation for Ubuntu","text":""},{"location":"en/index.html#script-of-post-installation-for-zorinos","title":"Script of post installation for ZorinOS","text":""},{"location":"en/index.html#security-app","title":"Security App","text":""},{"location":"en/Script%20post%20install%20for%20Fedora.html","title":"Script post install for Fedora","text":"<p>Coming soon</p>"},{"location":"en/Script%20post%20install%20for%20Mint.html","title":"Script post install for Mint","text":"<p>Coming soon</p>"},{"location":"en/Script%20post%20install%20for%20Ubuntu.html","title":"Script post install for Ubuntu","text":"<p>Coming soon</p>"},{"location":"en/Script%20post%20install%20for%20ZorinOS.html","title":"Script post install for ZorinOS","text":"<p>Coming soon</p>"},{"location":"en/Security%20App.html","title":"Security App","text":""},{"location":"en/Security%20App.html#decription","title":"Decription","text":"<p>This app is secured by a password (by default \"password\") and you can modify it. In this app, you can crypt and decrypt a message with a key using a symmetric encryption. Also, you can generate secured passwords and test yours. Finally, you can save whatever your want in the Passwords Manager which is also crypted with your password.</p>"},{"location":"en/Security%20App.html#customization","title":"Customization","text":"<p>You can customize the app by changing the palet in the top left and the language (English or French) in the top right. All this settings and datas will be saved in the user_data.json file.</p>"},{"location":"en/Security%20App.html#use-of-the-exe-file","title":"Use of the .exe file","text":"<p>To execute the .exe file, you need to make a shortcut of it on your desktop, else you have to find the file to execute it. You can't copy/paste the file on your desktop, it will not work.</p>"},{"location":"en/Security%20App.html#links","title":"Links","text":"<p>Link to the repo</p>"},{"location":"fr/index.html","title":"Documentation en Fran\u00e7ais","text":""},{"location":"fr/index.html#script-de-post-installation-pour-fedora","title":"Script de post installation pour Fedora","text":""},{"location":"fr/index.html#script-de-post-installation-pour-mint","title":"Script de post installation pour Mint","text":""},{"location":"fr/index.html#script-de-post-installation-pour-ubuntu","title":"Script de post installation pour Ubuntu","text":""},{"location":"fr/index.html#script-de-post-installation-pour-zorinos","title":"Script de post installation pour ZorinOS","text":""},{"location":"fr/index.html#security-app","title":"Security App","text":""},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html","title":"Script de post installation pour Fedora","text":"<p>Script de post-installation qui va installer certains logiciels, rajouter quelques fichiers tels que des fonds d'\u00e9cran et mettre \u00e0 jour le syst\u00e8me en un seul clic pour Fedora (toutes versions desktop).</p>"},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#applis-installees","title":"Applis install\u00e9es","text":""},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#extensions","title":"Extensions","text":"<p>Les extensions sont utiles pour avoir une meilleur approche de Fedora. Celles-ci sont install\u00e9es :</p> <ul> <li>Dash-to-dock (barre des t\u00e2ches sur le bureau)</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#applications","title":"Applications","text":""},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#rpm","title":"RPM","text":"<ul> <li>aspell-fr</li> <li>amd-ucode-firmware</li> <li>gnome-tweaks</li> <li>file-roller</li> <li>dconf-editor</li> <li>gnome-boxes</li> <li>ShellCheck</li> <li>htop</li> <li>neofetch</li> <li>screenfetch</li> <li>fastfetch</li> <li>inxi</li> <li>nfs-utils</li> <li>sl</li> <li>nyancat</li> <li>ecryptfs-utils</li> <li>cool-retro-term gparted</li> <li>btrfs-assistant</li> <li>git</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#flatpak-depot-flathub","title":"Flatpak (D\u00e9p\u00f4t Flathub)","text":"<ul> <li>VLC</li> <li>SongRec</li> <li>SoundConverter</li> <li>ExtensionManager</li> <li>Warehouse</li> <li>Flatseal</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#composants-rpm-fusion","title":"Composants RPM Fusion","text":"<ul> <li>rpmfusion-free-appstream-data</li> <li>rpmfusion-nonfree-appstream-data</li> <li>rpmfusion-free-release-tainted</li> <li>rpmfusion-nonfree-release-tainted</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#codecs","title":"Codecs","text":"<ul> <li>gstreamer1-plugins-base</li> <li>gstreamer1-plugins-good</li> <li>gstreamer1-plugins-bad-free</li> <li>gstreamer1-plugins-good-extras</li> <li>gstreamer1-plugins-bad-free-extras</li> <li>gstreamer1-plugins-ugly-free</li> <li>gstreamer1-plugin-libav</li> <li>gstreamer1-plugins-ugly</li> <li>libdvdcss</li> <li>gstreamer1-plugin-openh264</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#autres","title":"Autres","text":"<p>De plus, ce script ajuste la configuration de DNF pour rendre plus rapide les mises \u00e0 jour et les installations de logiciels en lignes de commande.</p> <p>Mises \u00e0 jour des flatpaks, des applications et du syst\u00e8me. Vous pouvez lancer le script autant de fois que n\u00e9cessaire.</p> <p>De plus, ce script offre la possibilit\u00e9 de configurer GNOME. Pour plus d'informations, voir Script de customisation.</p>"},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#lancer-le-script","title":"Lancer le script","text":"<p>VEUILLEZ AVOIR UNE CONNEXION STABLE ET ASSEZ RAPIDE (min. 2 Mo/s)</p> <p>LE SCRIPT PEUT ETRE LANC\u00c9 PLUSIEURS FOIS</p> <p>Lancer le programme :</p> <ul> <li> <p>Clic droit sur le fichier \"lancer-la-configuration-de-Fedora.sh\"</p> </li> <li> <p>Appuyez sur \"Ex\u00e9cuter comme programme\"</p> </li> </ul> <p>Si vous voulez seulement \u00e9x\u00e9cuter le script de customisation de GNOME, allez dans le dossier config-fedora et \u00e9x\u00e9cutez le fichier gnome-customization.sh</p> <p>Suite \u00e0 la configuration, des alias seront disponibles. Un alias est une chaine de caract\u00e8res qui va ex\u00e9cuter une commande longue pour gagner du temps. Voici ceux que vous pourrez utiliser :</p> Ex\u00e9cutez pour effectuer Exemple maj sudo dnf upgrade -y maj -&gt; mise \u00e0 jour du syst\u00e8me install sudo dnf install -y install app -&gt; installe l'application app remove sudo dnf remove -y remove app -&gt; supprimer l'application app fmaj flatpak update -y fmaj -&gt; mise \u00e0 jour de flatpak fsearch flatpak search fs mot-cle -&gt; recherche les flatpak contenant mot-cle finstall flatpak install flathub -y finstall ID -&gt; installe le flatpak avec l'identifiant ID depuis flathub fremove flatpak remove -y fremove ID -&gt; supprime le flatpak avec l'identifiant ID"},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#script-de-customisation","title":"Script de customisation","text":"<p>La customisation de GNOME va :</p> <ul> <li> <p>si vous le voulez rajouter des fonds d'\u00e9crans et/ou des fonds d'\u00e9crans dynamiques</p> </li> <li> <p>Rajouter les boutons minimiser et maximiser sur les fen\u00eatres</p> </li> <li> <p>Augmenter la limite du son</p> </li> <li> <p>Afficher le calendrier sur le panneau sup\u00e9rieur</p> </li> <li> <p>Modifier le format date et heure :</p> </li> <li> <p>Afficher la date</p> </li> <li> <p>Afficher les secondes</p> </li> <li> <p>Afficher le jour de la semaine</p> </li> <li> <p>Heure au format 24h</p> </li> <li> <p>Supprimer les fichiers temporaires et de la corbeille</p> </li> <li> <p>D\u00e9sactiver l'ouverture du dossier lorsqu'un fichier est gliss\u00e9 dedans</p> </li> <li> <p>Activer le double-clic</p> </li> <li> <p>Afficher les dossiers avant les fichiers</p> </li> <li> <p>D\u00e9sactiver la surlignement de la ligne actuelle</p> </li> <li> <p>Afficher les num\u00e9ros de ligne dans l'\u00e9diteur de texte</p> </li> <li> <p>Activer l'extension Dash-to-Dock</p> </li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#personnalisation-de-fedora","title":"Personnalisation de Fedora","text":"<p>Pour les fonds d'\u00e9crans, un dossier wallpapers \u00e0 \u00e9t\u00e9 cr\u00e9e dans ~/Images/</p> <p>Dans ce m\u00eame dossier, vous allez trouver un dossier screenshots_dynamic_wallpapers qui contient les aper\u00e7us des changements fonds d'\u00e9crans dynamiques.</p> <p>Vous pouvez choisir un fond d'\u00e9cran dynamique :</p> <ul> <li> <p>clic droit sur le bureau</p> </li> <li> <p>Modifier l'arri\u00e8re plan...</p> </li> <li> <p>s\u00e9lectionnez un fond d'\u00e9cran avec une horloge en bas \u00e0 gauche de l'image pour s\u00e9lectionner un fond d'\u00e9cran dynamique</p> </li> </ul> <p>Si vous souhaitez personnalisez Fedora plus en profondeur, regardez cette playlist.</p>"},{"location":"fr/Script%20post%20installation%20pour%20Fedora.html#liens","title":"Liens","text":"<p>Lien du repo</p>"},{"location":"fr/Script%20post%20installation%20pour%20Mint.html","title":"Script de post installation pour Mint","text":"<p>Script de post-installation qui va installer certains logiciels, rajouter quelques fichiers tels que des fonds d'\u00e9cran et mettre \u00e0 jour le syst\u00e8me en un seul clic pour Mint (toutes versions desktop).</p>"},{"location":"fr/Script%20post%20installation%20pour%20Mint.html#applis-installees","title":"Applis install\u00e9es","text":""},{"location":"fr/Script%20post%20installation%20pour%20Mint.html#applications","title":"Applications","text":"<ul> <li>aspell-fr</li> <li>amd-ucode-firmware</li> <li>gnome-tweaks</li> <li>file-roller</li> <li>dconf-editor</li> <li>gnome-boxes</li> <li>ShellCheck</li> <li>htop</li> <li>neofetch</li> <li>screenfetch</li> <li>fastfetch</li> <li>inxi</li> <li>nfs-utils</li> <li>sl</li> <li>nyancat</li> <li>ecryptfs-utils</li> <li>cool-retro-term</li> <li>gparted</li> <li>numlockx</li> <li>git</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Mint.html#flatpak-depot-flathub","title":"Flatpak (D\u00e9p\u00f4t Flathub)","text":"<ul> <li>VLC</li> <li>SongRec</li> <li>SoundConverter</li> <li>Warehouse</li> <li>Flatseal</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Mint.html#autre","title":"Autre","text":"<p>Mises \u00e0 jour des flatpaks, des applications et du syst\u00e8me. Vous pouvez lancer le script autant de fois que n\u00e9cessaire.</p> <p>De plus, ce script offre la possibilit\u00e9 de configurer Cinnamon. Pour plus d'informations, voir script de customisation.</p>"},{"location":"fr/Script%20post%20installation%20pour%20Mint.html#lancer-le-script","title":"Lancer le script","text":"<p>VEUILLEZ AVOIR UNE CONNEXION STABLE ET ASSEZ RAPIDE (min. 2 Mo/s)</p> <p>LE SCRIPT PEUT ETRE LANC\u00c9 PLUSIEURS FOIS</p> <p>Lancer la programme:</p> <ul> <li> <p>Double-cliquez sur le fichier \"lancer-la-configuration-de-Mint.sh\"</p> </li> <li> <p>Appuyez sur \"Lancer dans un terminal\" tout \u00e0 droite</p> </li> </ul> <p>Vous pouvez activer l'option \"Activer le verrouillage du pav\u00e9 num\u00e9rique\" dans les options de l'\u00e9cran de connexion (param\u00e8tres) pour verrouiller le pav\u00e9 num\u00e9rique sur l'\u00e9cran de verrouillage.</p> <p>Si vous voulez seulement \u00e9x\u00e9cuter le script de customisation de CINNAMON, allez dans le dossier config-lm et \u00e9x\u00e9cutez le fichier cinnamon-customization.sh</p> <p>Suite \u00e0 la configuration, des alias seront disponibles. Un alias est une chaine de caract\u00e8res qui va ex\u00e9cuter une commande longue pour gagner du temps. Voici ceux que vous pourrez utiliser :</p> Ex\u00e9cutez pour effectuer Exemple maj sudo apt upgrade -y maj -&gt; mise \u00e0 jour du syst\u00e8me install sudo apt install -y install app -&gt; installe l'application app remove sudo apt remove -y remove app -&gt; supprimer l'application app fmaj flatpak update -y fmaj -&gt; mise \u00e0 jour de flatpak fsearch flatpak search fs mot-cle -&gt; recherche les flatpak contenant mot-cle finstall flatpak install flathub -y finstall ID -&gt; installe le flatpak avec l'identifiant ID depuis flathub fremove flatpak remove -y fremove ID -&gt; supprime le flatpak avec l'identifiant ID"},{"location":"fr/Script%20post%20installation%20pour%20Mint.html#script-de-customisation","title":"Script de customisation","text":"<p>La customisation de CINNAMON va :</p> <ul> <li> <p>si vous le voulez rajouter des fonds d'\u00e9crans et/ou des fonds d'\u00e9crans dynamiques</p> </li> <li> <p>Augmenter la limite du son</p> </li> <li> <p>Modifier le format date et heure :</p> </li> <li> <p>Afficher la date</p> </li> <li> <p>Afficher les secondes</p> </li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Mint.html#personnalisation-de-mint","title":"Personnalisation de Mint","text":"<p>Pour afficher le dossier wallpapers (~/Images/) dans la fen\u00eatre des fonds d'\u00e9cran :</p> <ul> <li> <p>clic droit sur le bureau &gt; modifier l'arri\u00e8re plan du bureau</p> </li> <li> <p>appuyez sur le \"+\" en bas \u00e0 gauche</p> </li> <li> <p>allez dans Images</p> </li> <li> <p>s\u00e9l\u00e9ctionnez wallpapers</p> </li> <li> <p>cliquez sur ouvrir en bas \u00e0 droite</p> </li> </ul> <p>Si vous souhaitez personnaliser Mint plus en profondeur, regardez cette playlist.</p>"},{"location":"fr/Script%20post%20installation%20pour%20Mint.html#liens","title":"Liens","text":"<p>Lien du repo</p>"},{"location":"fr/Script%20post%20installation%20pour%20Ubuntu.html","title":"Script de post installation pour Ubuntu","text":"<p>Script qui va installer certains logiciels, rajouter quelques fichiers tels que des fonds d'\u00e9cran et mettre \u00e0 jour le syst\u00e8me en un seul clic pour Ubuntu (toutes versions desktop).</p>"},{"location":"fr/Script%20post%20installation%20pour%20Ubuntu.html#applis-installees","title":"Applis install\u00e9es","text":"<ul> <li>aspell-fr</li> <li>amd-ucode-firmware</li> <li>gnome-tweaks</li> <li>file-roller</li> <li>dconf-editor</li> <li>gnome-boxes</li> <li>ShellCheck</li> <li>htop</li> <li>neofetch</li> <li>screenfetch</li> <li>fastfetch</li> <li>inxi</li> <li>nfs-utils</li> <li>sl</li> <li>nyancat</li> <li>ecryptfs-utils</li> <li>cool-retro-term</li> <li>gparted</li> <li>git</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Ubuntu.html#flatpak-depot-flathub","title":"Flatpak (D\u00e9p\u00f4t Flathub)","text":"<ul> <li>VLC</li> <li>SongRec</li> <li>SoundConverter</li> <li>ExtensionManager</li> <li>Warehouse</li> <li>Flatseal</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Ubuntu.html#autres","title":"Autres","text":"<p>Mises \u00e0 jour des flatpaks, des applications et du syst\u00e8me. Vous pouvez lancer le script autant de fois que n\u00e9cessaire.</p> <p>De plus, ce script offre la possibilit\u00e9 de configurer GNOME. Pour plus d'informations, voir script de customisation.</p>"},{"location":"fr/Script%20post%20installation%20pour%20Ubuntu.html#lancer-le-script","title":"Lancer le script","text":"<p>VEUILLEZ AVOIR UNE CONNEXION STABLE ET ASSEZ RAPIDE (min. 2 Mo/s)</p> <p>LE SCRIPT PEUT ETRE LANC\u00c9 PLUSIEURS FOIS</p> <p>Lancer le programme :     - Clic droit sur le fichier \"lancer-la-configuration-de-Ubuntu.sh\"     - Appuyez sur \"Ex\u00e9cuter comme programme</p> <p>Si vous voulez seulement \u00e9x\u00e9cuter le script de customisation de GNOME, allez dans le dossier config-ubuntu et \u00e9x\u00e9cutez le fichier gnome-customization.sh</p> <p>Suite \u00e0 la configuration, des alias seront disponibles. Un alias est une chaine de caract\u00e8res qui va ex\u00e9cuter une commande longue pour gagner du temps. Voici ceux que vous pourrez utiliser :</p> Ex\u00e9cutez pour effectuer Exemple maj sudo apt upgrade -y maj -&gt; mise \u00e0 jour du syst\u00e8me install sudo apt install -y install app -&gt; installe l'application app remove sudo apt remove -y remove app -&gt; supprimer l'application app fmaj flatpak update -y fmaj -&gt; mise \u00e0 jour de flatpak fsearch flatpak search fs mot-cle -&gt; recherche les flatpak contenant mot-cle finstall flatpak install flathub -y finstall ID -&gt; installe le flatpak avec l'identifiant ID depuis flathub fremove flatpak remove -y fremove ID -&gt; supprime le flatpak avec l'identifiant ID"},{"location":"fr/Script%20post%20installation%20pour%20Ubuntu.html#script-de-customisation","title":"Script de customisation","text":"<p>La customisation de GNOME va :</p> <ul> <li> <p>Augmenter la limite du son</p> </li> <li> <p>Modifier le format date et heure :</p> </li> <li> <p>Afficher la date</p> </li> <li> <p>Afficher les secondes</p> </li> <li> <p>Afficher le jour de la semaine</p> </li> <li> <p>Heure au format 24h</p> </li> <li> <p>Supprimer les fichiers temporaires et de la corbeille</p> </li> <li> <p>D\u00e9sactiver la surlignement de la ligne actuelle</p> </li> <li> <p>Afficher les num\u00e9ros de ligne dans l'\u00e9diteur de texte</p> </li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20Ubuntu.html#personnalisation-de-ubuntu","title":"Personnalisation de Ubuntu","text":"<p>Pour les fonds d'\u00e9crans, un dossier wallpapers \u00e0 \u00e9t\u00e9 cr\u00e9e dans ~/Images/</p> <p>Dans ce m\u00eame dossier, vous allez trouver un dossier screenshots_dynamic_wallpapers qui contient les aper\u00e7us des fonds d'\u00e9crans dynamiques.</p> <p>Vous pouvez choisir un fond d'\u00e9cran dynamique :</p> <ul> <li> <p>clic droit sur le bureau</p> </li> <li> <p>modifier le fond d'\u00e9cran</p> </li> <li> <p>s\u00e9lectionnez un fond d'\u00e9cran avec une horloge en bas \u00e0 droite de l'image pour s\u00e9lectionnez un fond d'\u00e9cran dynamique</p> </li> </ul> <p>Si vous souhaitez personnalisez Ubuntu plus en profondeur, regardez cette playlist</p>"},{"location":"fr/Script%20post%20installation%20pour%20Ubuntu.html#liens","title":"Liens","text":"<p>Lien du repo</p>"},{"location":"fr/Script%20post%20installation%20pour%20ZorinOS.html","title":"Script de post installation pour ZorinOS","text":"<p>Script qui va installer certains logiciels, rajouter quelques fichiers tels que des fonds d'\u00e9cran et mettre \u00e0 jour le syst\u00e8me en un seul clic pour ZorinOS (toutes versions desktop).</p>"},{"location":"fr/Script%20post%20installation%20pour%20ZorinOS.html#applis-installees","title":"Applis install\u00e9es","text":"<ul> <li>aspell-fr</li> <li>amd-ucode-firmware</li> <li>gnome-tweaks</li> <li>file-roller</li> <li>dconf-editor</li> <li>gnome-boxes</li> <li>ShellCheck</li> <li>htop</li> <li>neofetch</li> <li>screenfetch</li> <li>fastfetch</li> <li>inxi</li> <li>nfs-utils</li> <li>sl</li> <li>nyancat</li> <li>ecryptfs-utils</li> <li>cool-retro-term</li> <li>gparted</li> <li>git</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20ZorinOS.html#flatpak-depot-flathub","title":"Flatpak (D\u00e9p\u00f4t Flathub)","text":"<ul> <li>VLC</li> <li>SongRec</li> <li>SoundConverter</li> <li>ExtensionManager</li> <li>Warehouse</li> <li>Flatseal</li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20ZorinOS.html#autres","title":"Autres","text":"<p>Mises \u00e0 jour des flatpaks, des applications et du syst\u00e8me. Vous pouvez lancer le script autant de fois que n\u00e9cessaire.</p> <p>De plus, ce script offre la possibilit\u00e9 de configurer GNOME. Pour plus d'informations, voir script de customisation</p>"},{"location":"fr/Script%20post%20installation%20pour%20ZorinOS.html#lancer-le-script","title":"Lancer le script","text":"<p>VEUILLEZ AVOIR UNE CONNEXION STABLE ET ASSEZ RAPIDE (min. 2 Mo/s)</p> <p>LE SCRIPT PEUT ETRE LANC\u00c9 PLUSIEURS FOIS</p> <p>Lancer le programme :</p> <ul> <li> <p>Clic droit sur le fichier \"lancer-la-configuration-de-ZorinOS.sh\"</p> </li> <li> <p>Appuyez sur \"Ex\u00e9cuter comme programme\"</p> </li> </ul> <p>Si vous voulez seulement \u00e9x\u00e9cuter le script de customisation de GNOME, allez dans le dossier config-zorin et \u00e9x\u00e9cutez le fichier gnome-customization.sh</p> <p>Suite \u00e0 la configuration, des alias seront disponibles. Un alias est une chaine de caract\u00e8res qui va ex\u00e9cuter une commande longue pour gagner du temps. Voici ceux que vous pourrez utiliser :</p> Ex\u00e9cutez pour effectuer Exemple maj sudo apt upgrade -y maj -&gt; mise \u00e0 jour du syst\u00e8me install sudo apt install -y install app -&gt; installe l'application app remove sudo apt remove -y remove app -&gt; supprimer l'application app fmaj flatpak update -y fmaj -&gt; mise \u00e0 jour de flatpak fsearch flatpak search fs mot-cle -&gt; recherche les flatpak contenant mot-cle finstall flatpak install flathub -y finstall ID -&gt; installe le flatpak avec l'identifiant ID depuis flathub fremove flatpak remove -y fremove ID -&gt; supprime le flatpak avec l'identifiant ID"},{"location":"fr/Script%20post%20installation%20pour%20ZorinOS.html#script-de-customisation","title":"Script de customisation","text":"<p>La customisation de GNOME va :</p> <p>-Augmenter la limite du son</p> <ul> <li> <p>Afficher le calendrier sur le panneau sup\u00e9rieur</p> </li> <li> <p>Modifier le format date et heure :</p> </li> <li> <p>Afficher la date</p> </li> <li> <p>Afficher les secondes</p> </li> <li> <p>Afficher le jour de la semaine</p> </li> <li> <p>Heure au format 24h</p> </li> <li> <p>Supprimer les fichiers temporaires et de la corbeille</p> </li> <li> <p>D\u00e9sactiver la surlignement de la ligne actuelle</p> </li> <li> <p>Afficher les num\u00e9ros de ligne dans l'\u00e9diteur de texte</p> </li> </ul>"},{"location":"fr/Script%20post%20installation%20pour%20ZorinOS.html#personnalisation-de-zorinos","title":"Personnalisation de ZorinOS","text":"<p>Pour les fonds d'\u00e9crans, un dossier wallpapers \u00e0 \u00e9t\u00e9 cr\u00e9e dans ~/Images/</p> <p>Dans ce m\u00eame dossier, vous allez trouver un dossier screenshots_dynamic_wallpapers qui contient les aper\u00e7us des fonds d'\u00e9crans dynamiques.</p> <p>Vous pouvez choisir un fond d'\u00e9cran dynamique :</p> <ul> <li> <p>clic droit sur le bureau</p> </li> <li> <p>modifier le fond d'\u00e9cran</p> </li> <li> <p>s\u00e9lectionnez un fond d'\u00e9cran avec une horloge en bas \u00e0 droite de l'image pour s\u00e9lectionnez un fond d'\u00e9cran dynamique</p> </li> </ul> <p>Si vous souhaitez personnalisez ZorinOS plus en profondeur, regardez cette playlist</p>"},{"location":"fr/Script%20post%20installation%20pour%20ZorinOS.html#liens","title":"Liens","text":"<p>Lien du repo</p>"},{"location":"fr/Security%20App.html","title":"Security App","text":""},{"location":"fr/Security%20App.html#decription","title":"Decription","text":"<p>Cette application est s\u00e9curis\u00e9e par un mot de passe (prar d\u00e9faut \"password\") et vous pouvez le modifier. Dans cette appli, vous pouvez chiffrer et d\u00e9chiffrer un message avec une cl\u00e9 en utilisant un chiffrement sym\u00e9trique. Aussi, vous pouvez g\u00e9n\u00e9rer des mots de passe s\u00e9curis\u00e9s et tester les votres. Enfin, vous poivez sauvegarder ce que vous voulez dans le gestionnaire de mot de passe qui est aussi chiffr\u00e9 avec votre mot de passe en clair.</p>"},{"location":"fr/Security%20App.html#customisation","title":"Customisation","text":"<p>Vous pouvez custmoiser l'application en changeant la palette dans le coin haut gauche et le language (Fran\u00e7ais ou Anglais) dans le coin haut droit. Tous ces param\u00e8tres et donn\u00e9es sont sauvegard\u00e9es dans le fichier user_data.json.</p>"},{"location":"fr/Security%20App.html#utilisation-du-fichier-exe","title":"Utilisation du fichier .exe","text":"<p>Pour \u00e9xecuter le fichier .exe, vous devez en faire un raccouri sur votre bureau, sinon vous devez aller chercher le fichier pour l'\u00e9xecuter. Vous ne pouvez pas copier/coller les fichiers sur le bureau, cela ne va pas marcher.</p>"},{"location":"fr/Security%20App.html#liens","title":"Liens","text":"<p>Lien vers le repo</p>"}]}